import React from 'react';

const num = () => {
	return Math.round(Math.random()*5);
}

const message = () => {
	if (true) {
		return 'Hello ' + num();
	}
}

const Banner = (props) => {
	return (
		<div>
			<p>{
				message()
			}</p>
			<div id='banner' title='"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'></div>
		</div>
	);
}

export default Banner;
